INSERT INTO butler_butlerpages VALUES(3,replace('\n            <p class="my-4 text-head-butler">О КОМПАНИИ</p>\n            <p class="text-paragraph-butler">Клининговая компания «Дворецкий» предоставляет полный спектр услуг по качественной и профессиональной уборке помещений: автосалонов, торговых центров, офисов, административных зданий, производственных помещений и прилегающих к ним территорий, а также частных объектов.</p>\n            <p class="my-4 text-head-butler">НАШИ ПРЕИМУЩЕСТВА</p>\n            <p class="text-paragraph-butler">Индивидуальный подход к каждому клиенту. За каждым объектом закрепляется персональный менеджер.</p>\n            <p class="text-paragraph-butler">Сотрудничество с нами - это залог спокойствия и удобства для наших клиентов.</p>\n            <p class="text-paragraph-butler">Основной принцип нашей работы – это клиентоориентированность.</p>\n            <p class="text-paragraph-butler">Мы применяем только новейшие, безопасные чистящие средства, нанимаем только высококвалифицированный персонал и проводим постоянный контроль качества выполнения работ.</p>\n            <p class="text-paragraph-butler">Все необходимые средства и оборудование, применяемые для уборки нашей компанией, имеют сертификаты качества.</p>\n            <p class="text-paragraph-butler">Мы несем ответственность за сохранность ценных вещей во время уборки.</p>\n            <p class="my-4 text-head-butler">ПАКЕТНОЕ ОБСЛУЖИВАНИЕ</p>\n            <p class="text-paragraph-butler">Мы предлагаем пакетное обслуживание на ежемесячной основе:</p>\n            <p class="text-paragraph-butler">Уборка проводится 4 раза в месяц по предварительному согласованию даты и времени проведения работ</p>\n            <p class="text-paragraph-butler">Если Вы приобрели пакет услуг и уехали в отпуск, компания предоставляет возможность «заморозки» неиспользованных уборок.</p>\n            ','\n',char(10)),'mainpage');
